class Solution {

    /**
     * @param Integer[] $nums1
     * @param Integer[] $nums2
     * @return Integer
     */
    function minSum($nums1, $nums2) {
        $sum1 = array_sum($nums1);
        $sum2 = array_sum($nums2);
        $zeros1 = count(array_filter($nums1, function($val) { return $val === 0; }));
        $zeros2 = count(array_filter($nums2, function($val) { return $val === 0; }));

        if ($sum1 === $sum2 && $zeros1 === 0 && $zeros2 === 0) {
            return $sum1;
        }

        if (($sum1 - $sum2) % ($zeros2 - $zeros1) === 0 && ($sum1 - $sum2) / ($zeros2 - $zeros1) > 0) {
            $diff = ($sum1 - $sum2) / ($zeros2 - $zeros1);
            if ($zeros1 > $zeros2) {
                return $sum1 + $zeros1 * $diff;
            } else {
                return $sum2 + $zeros2 * $diff;
            }
        }

        return -1;
    }
}
